import React, { Component } from 'react';

class Container extends Component {
    render() {
        return (
            <div id="Container">
                <style jsx>
                    { `
                    #Container {
                        margin: 0 2%;
                    }
                    @media only screen and (min-width:1024px) {
                        max-width: 1024px;
                        margin: 0 auto;
                    }
                    `}
                </style>
                { this.props.children }
            </div>);
    }
}
export default Container;
